import React from 'react'
import '../'

const Landing = () => (
  <div style={bgStyle}>
    <div className='textBlock' style={{ display: 'block', textAlign: 'center', marginTop: '20%'}}>
      <h1 style={h1Style}>Team 9 Post Office</h1>
      <p style={pStyle}>Supporting and delivering all your domestic shipping needs since 2019.</p>
    </div>
  </div>
);

const h1Style = {
  fontSize: '2.5rem',
  fontWeight: 500
};

const bgStyle = {
  backgroundImage: `url(${'/landing1.jpg'})`
};

const pStyle = {
  display: 'block',
  fontSize: '1.25rem',
  fontWeight: 250,
};

export default Landing
